import './style/App.css';

function App() {
  return (
    <div className="App">
      <div className='main'>
      <header>
        <h1>Cinemize</h1>
        <h3>The popcorn time</h3>
      </header>
      <footer>
        <ul>
          <li><a href=''>Privacy Policy</a></li>
          <li><a href=''>Terms & Conditions</a></li>
          <li><a href=''>Help</a></li>
        </ul>
      </footer>
      </div>
    </div>
  );
}

export default App;
